export default function NavBar({handleLogout}) {
    return(
        <div style={{display: "flex"}}>
            <div>
            <NavLink to="/home">Home</NavLink>
            </div>
            <div>
            <NavLink to="/myposts">My Posts</NavLink>
            </div>
            <button onClick={handleLogout}>Logout</button>
        </div>
    )
}
